import styled from 'styled-components'

const StyledProduct = styled.div`
    padding:20px;
    border-radius:25px;
    background: rgb(60, 60, 60);
    margin: 20px;
    color: cyan;
    font-size: 1.2rem;
    font-weight: 800;

    p {
        margin-top: 5px;
        margin-bottom: 5px;

    }

    button {
        font-size: 1rem;
        padding-top: 10px;
        padding-bottom: 10px;
        padding-left: 20px;
        padding-right: 20px;
        border-radius: 20px;
        color: rgb(60,60,60);
        margin-right: 20px;
        font-weight: 900;
    }

`

export default StyledProduct
